import React, { useState } from 'react'
import ReactDOM from 'react-dom'
import Square from './Square'

const Board = () => {
    const [boardArray, setBoardArray] = useState(Array(9).fill(null))

    const newSquare = (number) => {
        
        return <Square 
            number={number}/>
    }
    
    
    return (
        <div className="board">
            {newSquare(1)}
            {newSquare(2)}
            {newSquare(3)}
            {newSquare(4)}
            {newSquare(5)}
            {newSquare(6)}
            {newSquare(7)}
            {newSquare(8)}
            {newSquare(9)}
        </div>
    )
}

export default Board
